import React from 'react'
import Frame from '../img/candidates/img.png'

const Candid = props => {
    return (
        <div>
            <img src={Frame}></img>
            <div className='title'>
                <h1>{props.candidate.id}</h1>
                {/* <h2>{props.candidate.name}</h2> */}
            </div>
        </div>
    );
};
